sys_variable_value.value:
(function execute(inputs, outputs) {

    var successCodes = ['200', '202', '201'];
    var arrayUtil = new global.ArrayUtil();
    if (arrayUtil.contains(successCodes, inputs.status)) {
        var responseBody = JSON.parse(inputs['responseBody']);
        var versions = [];
        var data = [];
        for (var property in responseBody) {
            versions.push({
                label: responseBody[property]['name'],
                name: responseBody[property]['name']

            });
        }
        versions.push({
            label: 'latest',
            name: 'latest'

        });
        outputs.versions = {
            data: versions
        };
        outputs.status = 'Success';
    } else {
        new AzureComputeUtils().postErrorHandling(inputs, outputs);
    }
})(inputs, outputs);

